webpackJsonp([0x6f75f9e7e60c],{738:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Today we’re happy to announce the initial release of\n<a href="http://reactjs.net/">ReactJS.NET</a>, which makes it easier to use React and JSX\nin .NET applications, focusing specifically on ASP.NET MVC web applications.\nIt has several purposes:</p>\n<ul>\n<li>\n<p>On-the-fly JSX to JavaScript compilation. Simply reference JSX files and they\nwill be compiled and cached server-side.</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-html"><code class="gatsby-code-html">&lt;script src="@Url.Content("/Scripts/HelloWorld.jsx")"><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p>JSX to JavaScript compilation via popular minification/combination libraries\n(Cassette and ASP.NET Bundling and Minification). This is suggested for\nproduction websites.</p>\n</li>\n<li>\n<p>Server-side component rendering to make your initial render super fast.</p>\n</li>\n</ul>\n<p>Even though we are focusing on ASP.NET MVC, ReactJS.NET can also be used in\nWeb Forms applications as well as non-web applications (for example, in build\nscripts). ReactJS.NET currently only works on Microsoft .NET but we are working\non support for Linux and Mac OS X via Mono as well.</p>\n<h2 id="installation"><a href="#installation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Installation</h2>\n<p>ReactJS.NET is packaged in NuGet. Simply run <code class="gatsby-code-text">Install-Package React.Mvc4</code> in the\npackage manager console or search NuGet for “React” to install it.\n<a href="http://reactjs.net/docs">See the documentation</a> for more information. The\nGitHub project contains\n<a href="https://github.com/reactjs/React.NET/tree/master/src/React.Sample.Mvc4">a sample website</a>\ndemonstrating all of the features.</p>\n<p>Let us know what you think, and feel free to send through any feedback and\nreport bugs <a href="https://github.com/reactjs/React.NET">on GitHub</a>.</p>',excerpt:"Today we’re happy to announce the initial release of\n ReactJS.NET , which makes it easier to use React and JSX\nin .NET applications, focusing specifically on ASP.NET MVC web applications.\nIt has several purposes: On-the-fly JSX to JavaScript compilation. Simply reference JSX files and they\nwill be compiled and cached server-side. JSX to JavaScript compilation via popular minification/combination libraries\n(Cassette and ASP.NET Bundling and Minification). This is suggested for\nproduction websites…",frontmatter:{title:"Use React and JSX in ASP.NET MVC",next:null,prev:null,author:[{frontmatter:{name:"Daniel Lo Nigro",url:"https://d.sb/"}}]},fields:{date:"April 03, 2014",path:"blog/2014-04-04-reactnet.md",slug:"/blog/2014/04/04/reactnet.html"}},allMarkdownRemark:{edges:[{node:{frontmatter:{title:"React v16.7: No, This Is Not the One With Hooks"},fields:{slug:"/blog/2018/12/19/react-v-16-7.html"}}},{node:{frontmatter:{title:"React 16.x Roadmap"},fields:{slug:"/blog/2018/11/27/react-16-roadmap.html"}}},{node:{frontmatter:{title:"React Conf recap: Hooks, Suspense, and Concurrent Rendering"},fields:{slug:"/blog/2018/11/13/react-conf-recap.html"}}},{node:{frontmatter:{title:"React v16.6.0: lazy, memo and contextType"},fields:{slug:"/blog/2018/10/23/react-v-16-6.html"}}},{node:{frontmatter:{title:"Create React App 2.0: Babel 7, Sass, and More"},fields:{slug:"/blog/2018/10/01/create-react-app-v2.html"}}},{node:{frontmatter:{title:"Introducing the React Profiler"},fields:{slug:"/blog/2018/09/10/introducing-the-react-profiler.html"}}},{node:{frontmatter:{title:"React v16.4.2: Server-side vulnerability fix"},fields:{slug:"/blog/2018/08/01/react-v-16-4-2.html"}}},{node:{frontmatter:{title:"You Probably Don't Need Derived State"},fields:{slug:"/blog/2018/06/07/you-probably-dont-need-derived-state.html"}}},{node:{frontmatter:{title:"React v16.4.0: Pointer Events"},fields:{slug:"/blog/2018/05/23/react-v-16-4.html"}}},{node:{frontmatter:{title:"React v16.3.0: New lifecycles and context API"},fields:{slug:"/blog/2018/03/29/react-v-16-3.html"}}}]}},pathContext:{slug:"/blog/2014/04/04/reactnet.html"}}}});
